import React from 'react';
import head from './Header.module.css';

const Header = () => {
    return (
        <header className={head.header}>
            <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Hanna.svg/1200px-Hanna.svg.png' />
        </header>
    );
}

export default Header;
